import { useHistory } from 'react-router-dom';

export const useHistorys = () => {
    const history = useHistory();

    const goMain = (): void => {
        history.push('/main');
    };

    const goSignUp = (): void => {
        history.push('/signup');
    };

    const goLogin = (): void => {
        history.push('/login');
    };

    return {
        goMain,
        goSignUp,
        goLogin
    }
}
